pragma solidity ^0.6.0;

import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

import "./interfaces/IFAMToken.sol";
import "./interfaces/IFAMAsset.sol";

contract Store is Ownable, ReentrancyGuard{
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    IFAMToken public token;
    IFAMAsset public asset;


    mapping(uint256 => uint256) public minedNft;

    mapping(uint256 => uint256) public priceNft;
    mapping(uint256 => uint256) public maxAmountAllowedNft;

    constructor(IFAMToken _token, IFAMAsset _asset) public {
        token = _token;
        asset = _asset;
    }
    function _initializeNft() internal{
        maxAmountAllowedNft[0] = 50;
        maxAmountAllowedNft[1] = 70;
        maxAmountAllowedNft[2] = 130;

        priceNft[0] = 3000;
        priceNft[1] = 1000;
        priceNft[2] = 4000;
    }

    function buyNft(uint256 id, uint256 amount) public nonReentrant {
        require(amount>0);
        require(id>=0);
        require(maxAmountAllowedNft[id].sub(minedNft[id]) >= amount);
        require(priceNft[id]>0);

        uint256  amountRequired = priceNft[id].mul(amount);
        require(amountRequired>0);

        require (token.transferFrom(msg.sender, address(this), amountRequired), "Token Transfer failed");

        minedNft[id] = minedNft[id].add(amount);
        asset.mint(msg.sender, id, amount,"");

    }

    function buyBatchNft(uint256[] memory _ids, uint256[] memory _amounts) public nonReentrant {
        require(_ids.length > 0, "Store: invalid argument");
        require(_amounts.length > 0, "Store: invalid argument");
        require(_ids.length == _amounts.length, "Pool: invalid argument");

        uint256  amountRequired = 0;
        for (uint256 i = 0; i < _ids.length; i++) {
            uint256 id = _ids[i];
            require(id>=0);
            require(priceNft[id]>0);
            require(_amounts[id]>0);
            amountRequired = amountRequired.add(priceNft[id].mul(_amounts[id]));
        }
        require(amountRequired>0);
        require (token.transferFrom(msg.sender, address(this), amountRequired), "Token Transfer failed");

        for (uint256 i = 0; i < _ids.length; i++) {
            uint256 id = _ids[i];
            minedNft[id] = minedNft[id].add(_amounts[id]);
        }
        asset.mintBatch(msg.sender, _ids, _amounts,"");

    }

    function setMaxAmountAllowed(uint256 id, uint256 amount) public onlyOwner {
        maxAmountAllowedNft[id] = amount;
    }
    function setPriceNft(uint256 id, uint256 price) public onlyOwner {
        priceNft[id] = price;
    }
}
